void Over1cc_1_RBF_21_28_2_ScaleInputs(double* input, double minimum, double maximum, int size)
{
 double delta;
 long i;
 for(i=0; i<size; i++)
 {
	delta = (maximum-minimum)/(Over1cc_1_RBF_21_28_2_max_input[i]-Over1cc_1_RBF_21_28_2_min_input[i]);
	input[i] = minimum - delta*Over1cc_1_RBF_21_28_2_min_input[i]+ delta*input[i];
 }
}

void Over1cc_1_RBF_21_28_2_Normalise(double out[],long length)
{
  long i, j;
  double sum = 0.0;
  for(i=0; i<length; i++)
  {
   if(out[i]>100)
   {
    out[i] = 1.0;
    j = i;
    for(i=0; i<length; i++)
    {
     if(i!=j) out[i] = 0.0;
    }
    break;
   }
   else out[i] = exp(out[i]);
  }
  for(i=0; i<length; i++)
  {
   sum += out[i];
  }
  for(i=0; i<length; i++)
  {
   out[i] = out[i]/sum;
  }
}

